Comment:
Giao hàng quá chậm (kế hoạch giao trước 11h ngày 12/6, nhưng đến 12h ngày 13/6 mới giao);
Thông tin quảng cáo "loại trung" nhưng thực tế đa số nhỏ xíu (chỉ to hơn chai Coca tí xíu), mua 30 trái mà chưa được 50% loại trung. với giá bán 129,9k/10 trái nhỏ vậy là không hề rẻ (vì dừa xiêm bên Coop giá 22k to gấp 3 lần);
Điểm cộng duy nhất là nước ngon, ngọt.
